@LiarinChina @Mashimaro77 @CIA_in_China Russia is not equal to the Soviet Union.
If  you talk about "Stalin's steamroller" it only makes sense if you are talking about soldiers.
It's completely stupid to add civilian losses to Soviet losses and then blame the ratio on "Stalin's steamroller".

@elonmusk Would America allow Mexico to join in a military alliance with Russia, China and Iran?

Would America allow Russia to arm and train an army hundreds of thousands strong in Mexico?

Would America allow Russian missiles and Chinese "biological research facilities" in Mexico?

@SprinterMonitor Argentina/Algeria have lodged their BRICS application, Saudi has stated their intention to join.
but in the case of Indonesia, China as chair of BRICS invited Indonesia to join.
While it's not an issue in normal times for Indonesia to join, nowadays it's too politicised.
